import React from 'react';
import './contact.css'
const Contact = () => {
  return (
    <>
    <Topbar/>
    <div className="container">
      <h4>Contact Us</h4>
      <p>
        If you have any questions or inquiries, please feel free to contact us at:
        <br />
        Email: society@example.com
        <br />
        Phone: +1 (123) 456-7890
      </p>
    </div>
    </>
  );
};

export default Contact;
